DROP PROCEDURE IF EXISTS `answer_data`;
delimiter ;;
CREATE PROCEDURE `answer_data`()
BEGIN
	DECLARE
		i INT DEFAULT 1;
	DECLARE
		time TIMESTAMP;
	WHILE
			i <= 10000 DO
			
			SET time = CURRENT_TIMESTAMP ();
		
		SET i = i + 1;
		
	END WHILE;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for check_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `check_data`;
delimiter ;;
CREATE PROCEDURE `check_data`()
BEGIN
	DECLARE
		i INT DEFAULT 1;
	DECLARE
		time TIMESTAMP;
	DECLARE
		score INT;
	WHILE
			i <= 10000 DO
			
			SET time = CURRENT_TIMESTAMP ();
			SET score = FLOOR(50 + RAND() * 50);
			VALUES( i, time, score );
			SET i = i + 1;
		
	END WHILE;

END
;;
delimiter ;

