-- ----------------------------
-- Procedure structure for message_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `message_data`;
delimiter ;;
CREATE PROCEDURE `message_data`()
BEGIN
	DECLARE
		message_id INT DEFAULT 1;
	DECLARE message_time TIMESTAMP;
	DECLARE
		message_type INT DEFAULT 1;
	DECLARE
	  user_id INT DEFAULT 1;
	DECLARE
	  course_id INT DEFAULT 1;	
	DECLARE title CHAR(100);
	
	WHILE
			message_id <= 100 DO
			SET message_time = CURRENT_TIMESTAMP();
			SET message_type = MOD(message_id,2);
			SET user_id = CEIL(RAND()*100);
			SET course_id = CEIL(RAND()*10);
			SET title = CONCAT("信息", message_id);
			VALUES( message_id, message_time, message_type,user_id,course_id,title);
			SET message_id = message_id + 1;
		
	END WHILE;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for take_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `take_data`;
delimiter ;;
CREATE PROCEDURE `take_data`()
BEGIN
	DECLARE
		user_id INT DEFAULT 1;
	DECLARE
	  course_id INT DEFAULT 1;	
	DECLARE role INT DEFAULT 1;
	
	WHILE
			user_id <= 10 DO
			SET course_id = user_id;
			SET role = 0;
			VALUES(user_id,course_id,role);
			SET user_id = user_id +1;
	END WHILE;

	WHILE 
			user_id <= 100 DO
			SET course_id = MOD(user_id,10)+1;
			SET role = 1;
			VALUES(user_id,course_id,role);
			SET user_id = user_id +1;		
	END WHILE;

END
;;
delimiter ;

